import React from "react";
import PropTypes from "prop-types";

import { Divider } from "../../../atoms";
import { UserCoverPage, CardList } from "../../../molecules";
import { Descriptors } from "../../../organisms";
import { useFetch, FETCHSTATES } from "../../../../hooks";
import "./index.scss";

export const View = ({ user, toggleEditForm, isServiceProvider }) => {
  const [servicesData, servicesStatus] = useFetch(`user/${user.id}/services`);

  return (
    <div id="my-profile-view">
      <UserCoverPage {...user} toggleEditForm={toggleEditForm} />
      <Divider label="InformaciÃ³n personal" />
      <Descriptors {...user} isServiceProvider={isServiceProvider} />
      <Divider label="Mis Servicios" />
      <CardList
        data={
          servicesStatus === FETCHSTATES.success
            ? servicesData.services.own
            : []
        }
        xs={4}
        sm={4}
      />
      <Divider label="Mis servicios consumidos" />
      <CardList
        data={
          servicesStatus === FETCHSTATES.success
            ? servicesData.services.consumed
            : []
        }
        xs={4}
        sm={4}
      />
    </div>
  );
};

View.propTypes = {
  user: PropTypes.object,
  toggleEditForm: PropTypes.func,
  isServiceProvider: PropTypes.bool,
};
